typedef unsigned long CBaseHandle;
#define RandomInt(nMin, nMax) (rand() % (nMax - nMin + 1) + nMin);

void GloveChanger()
{
	if (Shonax::settingsxd.glovesenabled)
	{
		player_info_t localPlayerInfo;

		auto pLocal = m_pEntityList->GetClientEntity(m_pEngine->GetLocalPlayer());
		if (pLocal)
		{
			if (m_pEngine->GetPlayerInfo(m_pEngine->GetLocalPlayer(), &localPlayerInfo))
			{
				DWORD* hMyWearables = (DWORD*)((size_t)pLocal + ShonaxOffsets::m_hMyWearables);

				if (hMyWearables)
				{
					if (!m_pEntityList->GetClientEntityFromHandle((DWORD)hMyWearables[0]))
					{
						static ClientClass* pClass;

						if (!pClass)
							pClass = m_pClient->GetAllClasses();
						while (pClass)
						{
							if (pClass->m_ClassID == 45)
								break;
							pClass = pClass->m_pNext;
						}

						int iEntry = m_pEntityList->xdGetHighestEntityIndex() + 1;
						int iSerial = RandomInt(0x0, 0xFFF);
						
						pClass->m_pCreateFn(iEntry, iSerial);
						hMyWearables[0] = iEntry | (iSerial << 16);

						auto pEnt = m_pEntityList->GetClientEntityFromHandle((DWORD)hMyWearables[0]);

						if (pEnt)
						{
							int modelindex = 0;
							
							if (Shonax::settingsxd.gloves == 1)
								modelindex = m_pModelInfo->GetModelIndex(("models/weapons/v_models/arms/glove_bloodhound/v_glove_bloodhound.mdl"));
							else if (Shonax::settingsxd.gloves == 2)
								modelindex = m_pModelInfo->GetModelIndex(("models/weapons/v_models/arms/glove_sporty/v_glove_sporty.mdl"));
							else if (Shonax::settingsxd.gloves == 3)
								modelindex = m_pModelInfo->GetModelIndex(("models/weapons/v_models/arms/glove_slick/v_glove_slick.mdl"));
							else if (Shonax::settingsxd.gloves == 4)
								modelindex = m_pModelInfo->GetModelIndex(("models/weapons/v_models/arms/glove_handwrap_leathery/v_glove_handwrap_leathery.mdl"));
							else if (Shonax::settingsxd.gloves == 5)
								modelindex = m_pModelInfo->GetModelIndex(("models/weapons/v_models/arms/glove_motorcycle/v_glove_motorcycle.mdl"));
							else if (Shonax::settingsxd.gloves == 6)
								modelindex = m_pModelInfo->GetModelIndex(("models/weapons/v_models/arms/glove_specialist/v_glove_specialist.mdl"));

							int ItemDefinitionIndex;
							if (Shonax::settingsxd.gloves == 1)
							{
								ItemDefinitionIndex = 5027;
							}
							else if (Shonax::settingsxd.gloves == 2)
							{
								ItemDefinitionIndex = 5030;
							}
							else if (Shonax::settingsxd.gloves == 3)
							{
								ItemDefinitionIndex = 5031;
							}
							else if (Shonax::settingsxd.gloves == 4)
							{
								ItemDefinitionIndex = 5032;
							}
							else if (Shonax::settingsxd.gloves == 5)
							{
								ItemDefinitionIndex = 5033;
							}
							else if (Shonax::settingsxd.gloves == 6)
							{
								ItemDefinitionIndex = 5034;
							}
							else
								ItemDefinitionIndex = 0;

							int paintkit;
							if (Shonax::settingsxd.gloves == 1)
							{
								switch (Shonax::settingsxd.skingloves)
								{
								case 0:
									paintkit = 10006;
									break;
								case 1:
									paintkit = 10007;
									break;
								case 2:
									paintkit = 10008;
									break;
								case 3:
									paintkit = 10039;
									break;
								}
							}
							else if (Shonax::settingsxd.gloves == 2)
							{
								switch (Shonax::settingsxd.skingloves)
								{
								case 0:
									paintkit = 10018;
									break;
								case 1:
									paintkit = 10037;
									break;
								case 2:
									paintkit = 10038;
									break;
								case 3:
									paintkit = 10019;
									break;
								}
							}
							else if (Shonax::settingsxd.gloves == 3)
							{
								switch (Shonax::settingsxd.skingloves)
								{
								case 0:
									paintkit = 10013;
									break;
								case 1:
									paintkit = 10015;
									break;
								case 2:
									paintkit = 10016;
									break;
								case 3:
									paintkit = 10040;
									break;
								}
							}
							else if (Shonax::settingsxd.gloves == 4)
							{
								switch (Shonax::settingsxd.skingloves)
								{
								case 0:
									paintkit = 10009;
									break;
								case 1:
									paintkit = 10010;
									break;
								case 2:
									paintkit = 10021;
									break;
								case 3:
									paintkit = 10036;
									break;
								}
							}
							else if (Shonax::settingsxd.gloves == 5)
							{
								switch (Shonax::settingsxd.skingloves)
								{
								case 0:
									paintkit = 10024;
									break;
								case 1:
									paintkit = 10026;
									break;
								case 2:
									paintkit = 10027;
									break;
								case 3:
									paintkit = 10028;
									break;
								}
							}
							else if (Shonax::settingsxd.gloves == 6)
							{
								switch (Shonax::settingsxd.skingloves)
								{
								case 0:
									paintkit = 10030;
									break;
								case 1:
									paintkit = 10033;
									break;
								case 2:
									paintkit = 10034;
									break;
								case 3:
									paintkit = 10035;
									break;
								}
							}
							
							*(int*)((DWORD)pEnt + ShonaxOffsets::m_iItemDefinitionIndex) = ItemDefinitionIndex;
							*(int*)((DWORD)pEnt + ShonaxOffsets::m_iItemIDHigh) = -1;
							*(int*)((DWORD)pEnt + ShonaxOffsets::m_iEntityQuality) = 4;
							*(int*)((DWORD)pEnt + ShonaxOffsets::m_iAccountID) = localPlayerInfo.m_nXuidLow;
							*(float*)((DWORD)pEnt + ShonaxOffsets::m_flFallbackWear) = Shonax::settingsxd.glovewear;
							*(int*)((DWORD)pEnt + ShonaxOffsets::m_nFallbackSeed) = 0;
							*(int*)((DWORD)pEnt + ShonaxOffsets::m_nFallbackStatTrak) = -1;
							*(int*)((DWORD)pEnt + ShonaxOffsets::m_nFallbackPaintKit) = paintkit;
							*(int*)((DWORD)pEnt + ShonaxOffsets::m_hMyWearables) = 1;

							pEnt->SetModelIndex(modelindex);
							pEnt->PreDataUpdate(DATA_UPDATE_CREATED);
						}
					}
				}

			}
		}
	}
}







